import { Circles } from 'react-loader-spinner'


const Spinner=()=>{
return(
<Circles
  height="80"
  width="80"
  color="#4fa94d"
  ariaLabel="circles-loading"
  margin=" 25px"
  wrapperStyle={{}}
  wrapperClass=""
  visible={true}
/>)
}
export default Spinner;
